import React from "react";
import ReactDOM from "react-dom";

const img = "https://picsum.photos/200/300";

ReactDOM.render(
  <div>
    <h1 className="heading">Some food</h1>
    <div>
      <img src="{img}" />
    </div>
  </div>,
  document.getElementById("root")
);
